import React from "react";

const Items = ({ items, deleteItems }) => {
  const itemsList = items.length ? (
    items.map((item) => {
      return (
        <div className="item-collection" key={item.id}>
          <ul>
            <li>{item.content}</li>
            <button
              onClick={() => {
                deleteItems(item.id);
              }}
            >
              Done
            </button>
          </ul>
        </div>
      );
    })
  ) : (
    <p>You have no more stuff buy</p>
  );
  return <div className="item-list">{itemsList}</div>;
};
export default Items;
